import React, { Component } from "react";
import { Navbar, Brand, Container, Nav, Dropdown, Button } from "react-bootstrap";
import { useLocation } from "react-router-dom";
import logo_hyundai from '../img/MOBIS_LOGO.png';
import logo_hyundai1 from '../img/Icon ionic-md-arrow-dropdown.svg'

import './navbar.css';


function Header() {
   
  return (

    <Navbar bg="light">
    <Navbar.Brand href="#home"><img src={logo_hyundai} />
    </Navbar.Brand>
    <Navbar.Toggle />
  <Navbar.Collapse className="justify-content-end">
    <Navbar.Text>
     <a href="#login">Admin</a>
     <a href="#login"></a>
     <img src={logo_hyundai1} />
    </Navbar.Text>
  </Navbar.Collapse>
  </Navbar>
 
  
  );
}

export default Header;
